import {Navbar} from 'react-bootstrap';

const NavBar = () => (
    <div>
        <Navbar bg="primary" variant="dark">
            <Navbar.Brand>Online IT Software Solutions</Navbar.Brand>
        </Navbar>
    </div>
)
export default NavBar;
